IT'S PICNIC SZN!
& We Are Embracing Alberta's Golden Grain 🌾🌾

In the heart of Alberta, wheat is more than just a crop—it's a symbol of our heritage, resilience and delicious culinary traditions! 🍽️✨
From fluffy local bakery bread to fresh spring rolls and crispy crust pizzas, wheat is the star ingredient that brings them all to life. 🍕

But it doesn't stop there! Even a few of our most beloved Alberta brews owe their distinct flavor to the humble grain. 🍻🌾 The golden wheat fields that blanket our landscapes are responsible for crafting the perfect pint.

Here's 𝑾𝑯𝑬𝑨𝑻 I'm bringing to a picnic:

@sycbrewingco • Pineapple Fomo
@seachangebrewing • Blooty Call
@seppspizza • Margherita ‘Za
@farrowsandwiches • Grick + Feature
@anchayyeg • Green Papaya Salad, Vermicelli Special, Spring Rolls

Cheers to the golden grain that nourishes us, delights our taste buds and brings us all together! 🌾✨🍽️

